import React, { Component } from 'react';
import './App.css';
import {
    Container,
    Row,
    Col,
    Navbar,
    Button,
    }from 'reactstrap';

class App extends Component {

  render() {
    return (
        <Container>
          <Row>
              <Col>
                <Navbar>
                  <Button></Button>
                </Navbar>
              </Col>
          </Row>
        </Container>
    );
  }
}

export default App;
